tables.table_schema:
CREATE TABLE health_metrics ( 
  user_id INT PRIMARY KEY, 
  heart_rate INT, 
  sleep_quality INT, 
  calories_burned INT 
);

CREATE TABLE health_metrics (
    id INT PRIMARY KEY,
    date DATE,
    heart_rate INT,
    sleep_quality INT
);

CREATE TABLE calorie_intake (
    id INT PRIMARY KEY,
    date DATE,
    calories_burned INT
);

CREATE TABLE heart_rate (
    id UUID PRIMARY KEY,
    timestamp TIMESTAMP NOT NULL,
    rate INTEGER
);

CREATE TABLE sleep_quality (
    id UUID PRIMARY KEY,
    timestamp TIMESTAMP NOT NULL,
    quality INTEGER
);

CREATE TABLE calories_burned (
    id UUID PRIMARY KEY,
    timestamp TIMESTAMP NOT NULL,
    burned INTEGER
);

CREATE TABLE activities (
  activity_id INT PRIMARY KEY,
  date DATE,
  activity_name VARCHAR(50),
  duration_minutes INT
);

CREATE TABLE goals (
  goal_id INT PRIMARY KEY,
  user_id INT,
  target_calories_burned INT,
  target_sleep_hours FLOAT
);

CREATE TABLE heart_rate_metrics (
    id INT PRIMARY KEY,
    timestamp TIMESTAMP,
    value INT
);

CREATE TABLE sleep_quality_metrics (
    id INT PRIMARY KEY,
    timestamp TIMESTAMP,
    duration INT,
    quality VARCHAR(20)
);

CREATE TABLE calories_burned_metrics (
    id INT PRIMARY KEY,
    timestamp TIMESTAMP,
    calories_burned INT
);

CREATE TABLE daily_activity_summary (
    id INT PRIMARY KEY,
    date DATE,
    steps_taken INT,
    distance_covered DECIMAL(10, 2)
);

CREATE TABLE exercise_sessions (
    id INT PRIMARY KEY,
    session_date DATE,
    workout_type VARCHAR(50),
    duration_minutes INT
);
